import React, { useState } from 'react'

function UnMount() {
 
    const [count,setCount]=useState(0)


  return (
    <> 
            <UiRen/>
          <button  onClick={()=>setCount(count+1)}>Click</button>
    
    </>
  )
}

export default UnMount

function UiRen({count}){

    return(
        
        <div><p>count {count}</p></div>
    )
}
